description:
Verenigde Staten
Komedie / Drama
86 minuten

goed

met Ryan Reynolds, Emily Mortimer en Stuart Townsend

Frank is obsessief in het organiseren en regelen van zijn leven. Het lot dwingt hem echter zijn leven overhoop te gooien en met 
de wind mee te waaien, wat leidt tot onverwachte inzichten en een nieuwe liefde. Ook Franks vriend Buddy wordt meegetrokken in 
de nieuwe richting van Franks leven.
